import React, { Component } from "react";
import { Divider } from "antd";

import StudentPageLayout from "../Layout/StudentPageLayout";

import AssignmentsTab from "../../UI Components/AssignmentsTab/AssignmentsTab";
import './Overview.css'

const data = [
  {
    title: "TODO 1",
    desc:
      "PrhaskhfwhkjedjsfjkhLKFJHLveniam est."
  },
  {
    title: "TODO 2",
    desc:
      "Proident exercitation nisi labore sint laboris proident deserunt laborum culpa enim veniam est."
  },
  {
    title: "TODO 3",
    desc:
      "Proident exercitation nisi laboveniam est."
  },
];

class OverviewHome extends Component {
  state = {
    tabData: ["SUBJECT1", "SUBJECT2"]
  };
  render() {
    return (
      <StudentPageLayout>
        <div
          style={{
            display: "flex",
            width: "100%",
            justifyContent: "center",
            overflow: "scroll",
            flexWrap: "wrap",
            paddingTop: 80
          }}
        >
          <AssignmentsTab
            data={data.filter(item => item.title !== "TODO 3")} // Only show Subject 1 data
            tabData={[this.state.tabData[0]]} // Only show Subject 1 tab
            isCompleted={true}
            title="Subject 1"
            style={{ marginRight: 10 }} // Add right margin to separate tabs
          />
          <AssignmentsTab
            data={[]}
            tabData={[]}
            title="Subject 2"
            style={{ display: "none" }} // Hide empty tab
          />
        </div>
      </StudentPageLayout>
    );
  }
}

export default OverviewHome;
